import React from "react";

const social = () => {
  return (
    <div className="home__social">
      <a href="https://www.instagram.com/lhasang.t.lama/" className="home__social-icon" target="_blank">
        <i className="uil uil-instagram"></i>
      </a>
      <a href="https://www.linkedin.com/in/tulku18/" className="home__social-icon" target='_blank'>
      <i className="uil uil-linkedin"></i>
      </a>
      <a href="https://github.com/Mrlhasang18" className="home__social-icon" target='_blank'>
      <i className="uil uil-github-alt"></i>
      </a>
    </div>
  );
};

export default social;
